import { v4 } from "uuid";

export const menuItems = [
  {
    id: v4(),
    name: "Item 1",
    link: "#",
    active: false,
  },
  { id: v4(), name: "Item 2", link: "#", active: false },
  { id: v4(), name: "Item 3", link: "#", active: false },
];
